import React, { useState } from 'react';
import axios from 'axios';
import API_CONFIG from '../config/apiConfig';

export default function CourseContentForm({ courseId, onContentAdded }) {
  const [title, setTitle] = useState('');
  const [type, setType] = useState('lecture');
  const [description, setDescription] = useState('');
  const [resourceUrl, setResourceUrl] = useState('');
  const [order, setOrder] = useState(0);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    const token = localStorage.getItem('token');
    try {
      await axios.post(
        `${API_CONFIG.BASE_URL}/course-content`,
        {
          course: courseId,
          title,
          type,
          description,
          resourceUrl,
          order,
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setTitle('');
      setType('lecture');
      setDescription('');
      setResourceUrl('');
      setOrder(0);
      if (onContentAdded) onContentAdded();
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to add content');
    } finally {
      setLoading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="bg-white rounded-lg shadow p-6 mb-8">
      <h3 className="text-lg font-bold mb-4">Add Course Content</h3>
      {error && <div className="text-red-600 mb-2">{error}</div>}
      <div className="mb-3">
        <label className="block font-semibold mb-1">Title</label>
        <input value={title} onChange={e => setTitle(e.target.value)} required className="input w-full" />
      </div>
      <div className="mb-3">
        <label className="block font-semibold mb-1">Type</label>
        <select value={type} onChange={e => setType(e.target.value)} className="input w-full">
          <option value="lecture">Lecture</option>
          <option value="video">Video</option>
          <option value="document">Document</option>
          <option value="assignment">Assignment</option>
          <option value="quiz">Quiz</option>
          <option value="liveSession">Live Session</option>
        </select>
      </div>
      <div className="mb-3">
        <label className="block font-semibold mb-1">Description</label>
        <textarea value={description} onChange={e => setDescription(e.target.value)} className="input w-full" />
      </div>
      <div className="mb-3">
        <label className="block font-semibold mb-1">Resource URL</label>
        <input value={resourceUrl} onChange={e => setResourceUrl(e.target.value)} className="input w-full" />
      </div>
      <div className="mb-3">
        <label className="block font-semibold mb-1">Order</label>
        <input type="number" value={order} onChange={e => setOrder(Number(e.target.value))} className="input w-full" />
      </div>
      <button type="submit" className="btn btn-primary" disabled={loading}>
        {loading ? 'Adding...' : 'Add Content'}
      </button>
    </form>
  );
}
